Bastian Bux [Barret Oliver], a quiet boy who loves to read, is accosted by bullies on his way to school.
He hides in a bookstore, interrupting the grumpy bookseller, Mr. Coreander [Thomas Hill]. Bastian asks 
about one of the books he sees, but Mr. Coreander warns him it is &quot;not safe.&quot; Nevertheless, Bastian 
borrows the book, leaving a note promising to return it, and races towards school. He then hides in the 
school's attic to begin reading &quot;The Neverending Story.&quot;

